(1, 'en_US', 'additionalHomeContent', '<div class=\"additional_content\">\r\n<p style=\"text-align: justify;\"><img style=\"float: right; width: 324px; height: 341px;\" src=\"https://i.ibb.co/3hX8dHV/Ag1-19.png\"></p>\r\n<p style=\"text-align: justify;\"><strong>Datokarama English Education Journal</strong> is authorized by the English Tadris Department, Tarbiyah and Teacher Training Faculty, Datokarama State Islamic University Palu. The publication is issued twice a year, in June and December. This journal invites lecturers, researchers, and educational practitioners in the field of English Language Education and Teaching, Linguistics, and Literature, to write or disseminate research findings.</p>\r\n<p style=\"text-align: justify;\">This journal provides immediate open access to its content on the principle that making research freely available to the public supports a greater global exchange of knowledge.</p>\r\n<p align=\"justify\">&nbsp;</p>\r\n<p align=\"justify\">&nbsp;</p>\r\n<table class=\"data\" width=\"100%\" bgcolor=\"#ffffff\">\r\n<tbody>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>Journal Title</strong></td>\r\n<td width=\"80%\"><strong>: Datokarama English Education Journal<br></strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>Initials</strong></td>\r\n<td width=\"80%\"><strong>: dee<br></strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>Abbreviation</strong></td>\r\n<td width=\"80%\"><strong>: deejournal<br></strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>Frequency</strong></td>\r\n<td width=\"80%\"><strong>: Twice a year (June and December)<br></strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>Accredited</strong></td>\r\n<td width=\"80%\"><strong>: -</strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>DOI</strong></td>\r\n<td width=\"80%\"><strong>: 10.24239/dee</strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>ISSN</strong></td>\r\n<td width=\"80%\"><strong>: <a href=\"http://u.lipi.go.id/1594039644\" target=\"_blank\" rel=\"noopener\">2723-4967</a> (Online)</strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>Editor-in-Chief</strong></td>\r\n<td width=\"80%\"><strong>: Ruslin, S.Pd., M.Pd., M.Sc., Ph.D.<br></strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>Publisher</strong></td>\r\n<td width=\"80%\"><strong>: Tarbiyah and Teacher Training Faculty, Datokarama State Islamic University Palu<br></strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>Language</strong></td>\r\n<td width=\"80%\"><strong>: English<br></strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>Citation Analysis</strong></td>\r\n<td width=\"80%\"><strong>: <a href=\"https://scholar.google.com/citations?user=ybu8qScAAAAJ&amp;hl=id\" target=\"_blank\" rel=\"noopener\">Google Scholar</a></strong></td>\r\n</tr>\r\n<tr valign=\"top\">\r\n<td width=\"20%\"><strong>Indexed by<br></strong></td>\r\n<td width=\"80%\"><strong>:</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border=\"0\" width=\"100%\">\r\n<tbody>\r\n<tr>\r\n<td><a title=\"Garuda\" href=\"https://garuda.kemdikbud.go.id/journal/view/25152\" target=\"_blank\" rel=\"noopener\"><img src=\"/public/site/images/admin/GarudaBG.png\" width=\"100%\"></a></td>\r\n<td><a title=\"Google Scholar\" href=\"https://scholar.google.com/citations?user=ybu8qScAAAAJ&amp;hl=id\" target=\"_blank\" rel=\"noopener\"><img src=\"/public/site/images/admin/GoogleScholarBG.png\" width=\"100%\"></a></td>\r\n<td><a title=\"Crossref\" href=\"https://search.crossref.org/?q=datokarama+english+education+journal&amp;from_ui=yes\" target=\"_blank\" rel=\"noopener\"><img src=\"/public/site/images/admin/CrossrefBG.png\" width=\"100%\"></a></td>\r\n<td><a title=\"Road\" href=\"https://portal.issn.org/resource/issn/2723-4967\" target=\"_blank\" rel=\"noopener\"><img src=\"/pu