INSERT INTO `static_page_settings` (`static_page_id`, `locale`, `setting_name`, `setting_value`, `setting_type`) VALUES
(1, 'en_US', 'title', 'Focus and Scope', 'string'),
(1, 'en_US', 'content', '<p style=\"font-size: 14px; text-align: justify;\"><span style=\"font-size: small;\"><strong>DEEJournal</strong> invites&nbsp;lecturers, researchers, and educational practitioners in the field of English Language Education and Teaching, Linguistics, and Literature to write or disseminate research findings.</span></p>\r\n<p style=\"font-size: 14px; text-align: justify;\"><span style=\"font-size: small;\">Please read and understand the author guideliness thoroughly.</span></p>\r\n<p style=\"font-size: 14px; text-align: justify;\"><span style=\"font-size: small;\">The author submission must follow the rules in the guidelines. If the submitted manuscript does not follow the instruction or guidelines or even using a different format, it will be rejected by the editorial team right before it is reviewed. Editorial team will only accept the manuscript that links with the required format available.</span></p>\r\n<p style=\"font-size: 14px; text-align: justify;\"><span style=\"font-size: small;\">The decision on whether the manuscript is accepted or not in this following journal will be the Editorial Board\'s right based on reviewer\'s recommendation intensively.</span></p>', 'string'),
(2, 'en_US', 'title', 'Author Guidelines', 'string'),
(2, 'en_US', 'content', '<p><strong>Reporting Standard</strong> <br>Authors must present the original manuscript, not published in any form, and do not submit the same article to other journals until the publisher gives an answer regarding the feasibility of the manuscript. Authors should provide accurate and accountable research data. Authors must cite the sources appropriately by considering the content of the manuscript either in the form of written publications or personal interviews.</p>\r\n<p><strong>Originality and Plagiarism</strong> <br>The authors should ensure that they have written entirely original works, and if the authors have used the work and/or words of others that this has been appropriately cited or quoted.</p>\r\n<p><strong>Multiple, Redundant, or Concurrent Publication</strong> <br>An author should not in general publish manuscripts describing essentially the same research in more than one journal or primary publication. Submitting the same manuscript to more than one journal concurrently constitutes unethical publishing behavior and is unacceptable.</p>\r\n<p><strong>Authorship of the Paper</strong> <br>Authorship should be limited to those who have made a significant contribution to the conception, design, execution, or interpretation of the reported research. All those who have made significant contributions should be listed as co-authors. Where there are others who have participated in certain substantive aspects of the research project, they should be acknowledged or listed as contributors. The corresponding author should ensure that all appropriate co-authors and no inappropriate co-authors are included in the paper and that all co-authors have seen and approved the final version of the paper and have agreed to its submission for publication.</p>\r\n<p><strong>Data Access and Retention</strong> <br>Authors may be asked to provide the raw data in connection with a paper for editorial review, and should in any event be prepared to retain such data for a reasonable time after publication.</p>\r\n<p><strong>Disclosure and Conflicts of Interest</strong> <br>All authors should disclose in their manuscript any financial or other substantive conflicts of interest that might be construed to influence the results or interpretation of their manuscript. All sources of financial support for the project should be disclosed.</p>\r\n<p><strong>Fundamental Errors in Published Works</strong> <br>When an author discovers a significant error or inaccuracy in his/her own published work, it is the author\'s obligation to promptly notify the journal editor or publisher and cooperate with the editor to retract or correct the paper. If the editor or the publisher learns from a third party that a published work contains a significant error, it is the obligation of the author to promptly retract or correct the paper or provide evidence to the editor of the correctness of the original paper.</p>', 'string'),
(10, 'en_US', 'content', '<p>The authors should ensure that they have written entirely original works, and if the authors have used the work and/or words of others, that this has been appropriately cited or quoted. Plagiarism takes many forms, from \'passing off\' another\'s paper as the author\'s own paper, to copying or paraphrasing substantial parts of another\'s paper (without attribution), to claiming results from research conducted by others. Plagiarism in all its forms constitutes unethical publishing behavior and is unacceptable.</p>\r\n<p>The submitted articles will be checked using Turnitin. Articles that exceed normal percentage limits will need to be revised. If the submitted article is proven to be plagiarized, the article will be rejected/declined immediately.</p>', 'string'),
(10, 'en_US', 'title', 'Plagiarism Check', 'string'),
(9, 'en_US', 'content', '<p><strong>DEEJournal: Datokarama English Education Journal</strong> is issued twice a year. It is available online as open access sources. This statement clarifies ethical behavior of all parties involved in the act of publishing an article in this journal, including the Author, the Editor-in-Chief, the Editorial Team, the Reviewer, and the Publisher.&nbsp;</p>\r\n<p><strong>Ethical Guideline for Journal Publication</strong> <br>The publication of an article in <strong>DEEJournal:&nbsp;</strong><strong>Datokarama English Education Journal</strong> is an essential building block in the development of a coherent and respected network of knowledge. It is a direct reflection of the quality of the work of the authors and the institutions that support them. It is therefore important to agree upon standards of expected ethical behavior for all parties involved in the act of publishing: the author, the editor, the reviewer, the publisher, and the society.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>DUTIES OF AUTHORS</strong></span></p>\r\n<p><strong>Reporting Standard</strong> <br>Authors must present the original manuscript, not published in any form, and do not submit the same article to other journals until the publisher give an answer regarding the feasibility of the manuscript. Authors should provide accurate and accountable research data. Authors must cite the sources appropriately by considering the content of the manuscript either in the form of written publications and personal interviews.</p>\r\n<p><strong>Originality and Plagiarism</strong> <br>The authors should ensure that they have written entirely original works, and if the authors have used the work and/or words of others that this has been appropriately cited or quoted.</p>\r\n<p><strong>Multiple, Redundant, or Concurrent Publication</strong> <br>An author should not in general publish manuscripts describing essentially the same research in more than one journal or primary publication. Submitting the same manuscript to more than one journal concurrently constitutes unethical publishing behaviour and is unacceptable.</p>\r\n<p><strong>Authorship of the Paper</strong> <br>Authorship should be limited to those who have made a significant contribution to the conception, design, execution, or interpretation of the reported research. All those who have made significant contributions should be listed as co-authors. Where there are others who have participated in certain substantive aspects of the research project, they should be acknowledged or listed as contributors. The corresponding author should ensure that all appropriate co-authors and no inappropriate co-authors are included on the paper, and that all co-authors have seen and approved the final version of the paper and have agreed to its submission for publication.</p>\r\n<p><strong>Data Access and Retention</strong> <br>Authors may be asked to provide the raw data in connection with a paper for editorial review, and should in any event be prepared to retain such data for a reasonable time after publication.</p>\r\n<p><strong>Disclosure and Conflicts of Interest</strong> <br>All authors should disclose in their manuscript any financial or other substantive conflict of interest that might be construed to influence the results or interpretation of their manuscript. All sources of financial support for the project should be disclosed.</p>\r\n<p><strong>Fundamental Errors in Published Works</strong> <br>When an author discovers a significant error or inaccuracy in his/her own published work, it is the author\'s obligation to promptly notify the journal editor or publisher and cooperate with the editor to retract or correct the paper. If the editor or the publisher learns from a third party that a published work contains a significant error, it is the obligation of the author to promptly retract or correct the paper or provide evidence to the editor of the correctness of the original paper.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>DUTIES OF EDITORS</strong></span></p>\r\n<p><strong>Publication Decisions</strong> <br>The editors of&nbsp;<strong>DEEJournal:&nbsp;</strong><strong>Datokarama English Education Journal</strong> is responsible for deciding which articles submitted to the journal should be published. The validation of the work in question and its importance to researchers and readers must always drive such decisions. The editors may be guided by the policies of the journal\'s editorial team and constrained by such legal requirements as shall then be in force regarding libel, copyright infringement, and plagiarism. The editors may confer with other editors or reviewers in making their decisions.</p>\r\n<p><strong>Fair Play</strong> <br>An editor at any time evaluates manuscripts for their intellectual content without regard to race, gender, sexual orientation, religious belief, ethnic origin, citizenship, or political philosophy of the authors.</p>\r\n<p><strong>Confidentiality</strong> <br>The editors and any editorial staff must not disclose any information about a submitted manuscript to anyone other than the corresponding author, reviewers, potential reviewers, other editorial advisers, and the publisher, as appropriate.</p>\r\n<p><strong>Disclosure and Conflicts of Interest</strong> <br>Unpublished materials disclosed in a submitted manuscript must not be used in editors\' own research without the express written consent of the author.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>DUTIES OF PEER REVIEWERS</strong></span></p>\r\n<p><strong>Contribution to Editorial Decisions</strong> <br>Peer reviewer assists the editor in making editorial decisions and through the editorial communications with the author may also assist the author in improving the quality of a paper.</p>\r\n<p><strong>Promptness</strong> <br>Any selected referee who feels unqualified to review the research reported in a manuscript or knows that its prompt review will be impossible should notify the editors and excuse himself from the review process.<em><strong>&nbsp;</strong></em></p>\r\n<p><strong>Confidentiality</strong> <br>Any manuscripts received for review must be treated as confidential documents. They must not be shown to, or discussed with others except as authorized by the editor.</p>\r\n<p><strong>Standards of Objectivity</strong> <br>Reviews should be conducted objectively. Personal criticism of the author is inappropriate. The reviewers should express their views clearly with supporting rationale arguments.</p>\r\n<p><strong>Acknowledgement of Sources</strong> <br>Reviewers should identify the source of references that has not been cited by the authors. Any statement that an observation, derivation, or argument had been previously reported should be accompanied by the relevant citation. A reviewer should also call to the editor\'s attention any substantial similarity or overlap between the manuscript under consideration and any other published paper of which they have personal knowledge.</p>\r\n<p><strong>Disclosure and Conflict of Interest</strong> <br>Privileged information or ideas obtained through peer review must be kept confidential and not used for personal advantage. Reviewers should not consider manuscripts in which they have conflicts of interest resulting from competitive, collaborative, or other relationships with any of the authors or institutions connected to the papers.</p>', 'string'),
(7, 'en_US', 'title', 'Editorial Board', 'string'),
(7, 'en_US', 'content', '<p><span style=\"text-decoration: underline;\"><strong>Dean</strong></span><br><strong>Askar</strong>, (Scopus ID: <a href=\"https://www.scopus.com/authid/detail.uri?authorId=57518971800\">57518971800</a>), Datokarama State Islamic University, Palu, Indonesia.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Advisory</strong><strong>&nbsp;Board</strong></span><br><strong>Nurdin</strong>, (Scopus ID: <a href=\"https://www.scopus.com/authid/detail.uri?authorId=54881753300\">54881753300</a>), Datokarama State Islamic University, Palu, Indonesia. <br><strong>Teuku Zulfikar</strong>, (Scopus ID: <a href=\"http://www.scopus.com/inward/authorDetails.url?authorID=56233694800&amp;partnerID=MN8TOARS\">56233694800</a>), Ar-Raniry State Islamic University, Banda Aceh, Indonesia.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Editor-in-Chief</strong></span><br><strong>Ruslin</strong>, Datokarama State Islamic University, Palu, Indonesia.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Managing Editor</strong></span><br><strong>Hijrah Syam</strong>, Datokarama State Islamic University, Palu, Indonesia.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Editor</strong><strong>ial Staff</strong></span><br><strong>Zulfikri</strong>, Datokarama State Islamic University, Palu, Indonesia.<br><strong>Fatima</strong>, Datokarama State Islamic University, Palu, Indonesia.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Reviewers </strong></span><br><strong>Muhammad Ihsan</strong>, Datokarama State Islamic University, Palu, Indonesia.<br><strong>Nur Asmawati</strong>, Datokarama State Islamic University, Palu, Indonesia.<br><strong>Juliastuti</strong>, Datokarama State Islamic University, Palu, Indonesia.<br><strong>Ana Kuliahana</strong>, Datokarama State Islamic University, Palu, Indonesia.<br><strong>Abdul Gafur Marzuki</strong>, Datokarama State Islamic University, Palu, Indonesia.<br><strong>Darwis Jauhari Bandu</strong>, Datokarama State Islamic University, Palu, Indonesia<br><strong>Rahma Dini Warastuti</strong>, Datokarama State Islamic University, Palu, Indonesia.<br><strong>Khaeruddin Yusuf</strong>, Datokarama State Islamic University, Palu, Indonesia.<br><strong>Saepudin Mashuri</strong>, Datokarama State Islamic University, Palu, Indonesia.</p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Production Support</strong></span><br><strong>Mohammad Nur Ahsan</strong>, Datokarama State Islamic University, Palu, Indonesia.<strong><br>Firdiansyah Al</strong><strong>h</strong><strong>absyi</strong>, Datokarama State Islamic University, Palu, Indonesia.</p>', 'string'),
(8, 'en_US', 'title', 'Online Submission', 'string'),
(8, 'en_US', 'content', '<div id=\"onlineSubmissions\">\r\n<p>Already have a Username and Password for <strong>DEEJournal: Datokarama English Education Journal</strong>?<br><a class=\"action\" href=\"http://deejournal.org/index.php/dee/login\">GO TO LOGIN</a></p>\r\n<p>Need a Username and Password?<br><a class=\"action\" href=\"http://deejournal.org/index.php/dee/user/register\">GO TO REGISTRATION</a></p>\r\n<p>Registration and login are required to submit items online and to check the status of current submissions.</p>\r\n</div>', 'string'),
(9, 'en_US', 'title', 'Publication Ethics', 'string'),
(12, 'en_US', 'title', 'Article Processing Charge', 'string'),
(12, 'en_US', 'content', '<p>All articles published in our journal are open-access and available online, immediately upon publication. Datokarama English Education Journal does not charge APCs, submission charges, or other fees. All processes of article publication are free of charge.</p>', 'string'),
(16, 'en_US', 'title', 'Peer Review Process', 'string'),
(16, 'en_US', 'content', '<p>The review process uses a double-blind review system, which means that both the reviewer and author identities are concealed from the reviewers, and vice versa. Submitted article to this journal will be reviewed at least by 2 reviewers. The review process <span id=\"result_box\" class=\"short_text\" lang=\"en\">will take 30 regular days.&nbsp;</span>In the review process, reviewers consider the correspondence of title, abstract, discussion (findings) and conclusions. Beside, reviewers also examine the novelty, scientific impact, and references used in the paper. Inappropriate manuscripts to journal criteria are rejected promptly by the editors without external review. Reviewers only review evaluated and proper manuscripts to our scopes. Then, editors make a decision by considering the reviewerâ€™s recommendation in several possibilities: accepted, rejected, minor revision, or major revision.</p>', 'string'),
(20, 'en_US', 'title', 'Copyright & Licensing', 'string'),
(20, 'en_US', 'content', '<p><strong>Datokarama English Education Journal</strong> (DEEJournal) is published under the terms of a&nbsp;<a href=\"http://creativecommons.org/licenses/by-nc/4.0/\">Creative Commons Attribution-NonCommercial 4.0 International License</a>. Authors retain the copyright to their work and grant the DEEJournal right of first publication. Users may read, copy and distribute the work in any medium provided the authors and the journal are appropriately credited.</p>\r\n<p><strong>LICENSE TO PUBLISH</strong></p>\r\n<ol>\r\n<li><strong> License</strong></li>\r\n</ol>\r\n<p>All material published by Datokarama English Education Journal is protected under international copyright and intellectual property laws. The DEEJournal is licensed under a&nbsp;<a href=\"http://creativecommons.org/licenses/by-nc/4.0/\">Creative Commons Attribution-NonCommercial 4.0 International License</a>&nbsp;or an equivalent license as the optimal license for the publication, distribution, use, and reuse of scholarly works.</p>\r\n<p>This license permits anyone to compose, repair, and make derivative creation even for commercial purposes, as long as appropriate credit and proper acknowledgment of the original publication from a journal are made to allow users to trace back to the original manuscript and author.</p>\r\n<p>You must give appropriate credit, provide a link to the license, and indicate if changes were made. You may do so in any reasonable manner, but not in any way that suggests the licensor endorses you or your use. If you remix, transform or build upon the material, you must distribute your contributions under the same license as the original.</p>\r\n<ol start=\"2\">\r\n<li><strong> Authorâ€™s Warranties</strong></li>\r\n</ol>\r\n<p>The author warrants that the article is original, written by stated author/s, has not been published before, contains no unlawful statements, does not infringe the rights of others, is subject to copyright that is vested exclusively in the author and free of any third party rights, and that any necessary written permissions to quote from other sources have been obtained by the author/s.</p>\r\n<ol start=\"3\">\r\n<li><strong> User Rights</strong></li>\r\n</ol>\r\n<p>Under the <a href=\"http://creativecommons.org/licenses/by-nc/4.0/\">Creative Commons Attribution-NonCommercial 4.0 International License</a>, the author(s) and users are free to share (copy, distribute and transmit the contribution).</p>\r\n<ol start=\"4\">\r\n<li><strong> Rights of Authors</strong></li>\r\n</ol>\r\n<p>Authors retain the following rights:</p>\r\n<ul>\r\n<li>copyright, and other proprietary rights relating to the article, such as patent rights,</li>\r\n<li>the right to use the substance of the article in future own works, including lectures and books,</li>\r\n<li>the right to reproduce the article for own purposes, provided the copies are not offered for sale,</li>\r\n<li>the right to self-archive the article.</li>\r\n</ul>\r\n<ol start=\"5\">\r\n<li><strong> Co-Authorship</strong></li>\r\n</ol>\r\n<p>If the article was prepared jointly with other authors, the signatory of this form warrants that he/she has been authorized by all co-authors to sign this agreement on their behalf, and agrees to inform his/her co-authors of the terms of this agreement.</p>\r\n<ol start=\"6\">\r\n<li><strong> Termination</strong></li>\r\n</ol>\r\n<p>This agreement can be terminated by the author or DEEJournal upon two monthsâ€™ notice where the other party has materially breached this agreement and failed to remedy such breach within a month of being given the terminating partyâ€™s notice requesting such breach to be remedied. No breach or violation of this agreement will cause this agreement or any license granted in it to terminate automatically or affect the definition of DEEJournal.&nbsp;</p>\r\n<ol start=\"7\">\r\n<li><strong> Royalties</strong></li>\r\n</ol>\r\n<p>This agreement entitles the author to no royalties or other fees. To such extent as legally permissible, the author waives his or her right to collect royalties relative to the article in respect of any use of the article by DEEJournal or its sublicensee.</p>\r\n<ol start=\"8\">\r\n<li><strong> Miscellaneous</strong></li>\r\n</ol>\r\n<p>DEEJournal will publish the article (or have it published) in the Journal, if the articleâ€™s editorial process is successfully completed and DEEJournal or its sublicensee has become obligated to have the article published. DEEJournal may conform the article to a style of punctuation, spelling, capitalization and usage that it deems appropriate. The author acknowledges that the article may be published so that it will be publicly accessible and such access will be free of charge for the readers. DEEJournal will be allowed to sublicense the rights that are licensed to it under this agreement.&nbsp;</p>\r\n<p>&nbsp;</p>', 'string'),
(21, 'en_US', 'title', 'Open Access Statement', 'string'),
(21, 'en_US', 'content', '<p>This journal provides immediate open access to its content on the principle that making research freely available to the public supports a greater global exchange of knowledge.</p>\r\n<p>Benefits of open access for the author, include:</p>\r\n<ul>\r\n<li>Free access for all users worldwide</li>\r\n<li>Authors retain copyright to their work</li>\r\n<li>Increased visibility and readership</li>\r\n<li>Rapid publication</li>\r\n<li>No spatial constraints</li>\r\n</ul>\r\n<p>Works/articles in this journal are bound to <a href=\"https://creativecommons.org/licenses/by-nc/4.0/\" rel=\"license\">Creative Commons Attribution-NonCommercial 4.0 International License</a>.</p>', 'string');
