INSERT INTO `submission_comments` (`comment_id`, `comment_type`, `role_id`, `submission_id`, `assoc_id`, `author_id`, `comment_title`, `comments`, `date_posted`, `date_modified`, `viewable`) VALUES
(1, 1, 4096, 61, 2, 37, '', '<p><strong>Dear Author/s.</strong></p>\r\n<p>When submitting an article to a journal, it is important to follow all of the writing rules and guidelines provided in the journal\'s article template. This will help ensure that your article meets the standards and requirements of the journal and increases your chances of getting published.</p>\r\n<p>Some common rules and guidelines that you should follow when using a journal\'s article template include:</p>\r\n<ol>\r\n<li>\r\n<p>Formatting: The article should be formatted according to the guidelines provided by the journal, including font, font size, margins, and spacing.</p>\r\n</li>\r\n<li>\r\n<p>Sections: The article should be divided into sections, such as introduction, methods, results, and conclusion, as specified in the journal\'s template.</p>\r\n</li>\r\n<li>\r\n<p>References: All references should be cited correctly and formatted according to the journal\'s guidelines.</p>\r\n</li>\r\n<li>\r\n<p>Figures and Tables: Any figures or tables should be appropriately labeled and formatted according to the journal\'s guidelines.</p>\r\n</li>\r\n<li>\r\n<p>Language: The language used in the article should be clear, concise, and appropriate for the journal\'s audience.</p>\r\n</li>\r\n</ol>\r\n<p>By following these guidelines and any other instructions provided by the journal, you can increase the chances of your article being accepted for publication.</p>\r\n<p>Thank you for giving me the opportunity to review this manuscript. I appreciate the author\'s hard work and the valuable insights that their research provides.</p>\r\n<p><strong>Kind Regards.</strong></p>\r\n<p><strong>DEEJournal\'s Reviewer</strong></p>', '2023-04-18 13:25:07', NULL, 1),
(2, 1, 4096, 61, 1, 36, '', '<p>Dear Author/s</p>\r\n<p>Thank you for submitting your article for review. We appreciate your efforts in contributing to our journal. However, we kindly request that all writing should follow the example shown in our manuscript template.</p>\r\n<p>Best Regards,</p>\r\n<p>DEEJournal\'s Reviewer</p>', '2023-04-20 10:34:33', NULL, 1);
