INSERT INTO `submission_settings` (`submission_id`, `locale`, `setting_name`, `setting_value`) VALUES
(1, 'en_US', 'title', 'IMPROVING SPEAKING ABILITY BY USING SHORT MOVIES AT ELEVENTH GRADE STUDENTS OF SMA NEGERI 5 PALU'),
(1, 'en_US', 'cleanTitle', 'IMPROVING SPEAKING ABILITY BY USING SHORT MOVIES AT ELEVENTH GRADE STUDENTS OF SMA NEGERI 5 PALU'),
(1, 'en_US', 'abstract', '<p>This research focused on the application of short movies as a media in improving speaking ability at eleventh grade students of SMA Negeri 5 Palu. The researcher applied quasi experimental research design which involved two classes of students, they were experimental class and control class. The instruments of data collection were pretest and posttest. The pretest was used to measure prior knowledge of the students and the posttest was used to measure the development of the studentsâ€™ knowledge after the treatment. The t-test was analyzed to compare the mean scores of both classes. There is a significant difference score of the experimental class (1940) and the control class (1490). The level of significance was set up at 0.05 with 58 degree of freedom (df=29+31-2=58). The result of data analysis indicates that t<sub>counted</sub>(6.84) is higher than t<sub>table</sub> (2.002). It means that the hypothesis is accepted. Thus, the use of short movies can improve studentsâ€™ speaking ability at eleventh grade students of SMA Negeri 5 Palu.</p>'),
(1, 'en_US', 'prefix', ''),
(1, 'en_US', 'subtitle', ''),
(2, 'en_US', 'title', 'ERROR ANALYSIS IN WRITING OF THE TENTH GRADE STUDENTS OF MAN 1 PALU'),
(2, 'en_US', 'cleanTitle', 'ERROR ANALYSIS IN WRITING OF THE TENTH GRADE STUDENTS OF MAN 1 PALU'),
(2, 'en_US', 'abstract', '<p>Error analysis is an activity to identify, classify and interpreted or describe the errors made by someone in speaking or in writing and it is carried out to obtain information on common difficulties faced by someone in speaking or in writing English sentences. For students, error analysis is needed to show them in what aspect in grammar which is difficult for them, to show the errors made by the students, to know the source or the cause of the error and how the students can learn from their mistakes in order that they will not make some errors repeatedly. The purpose of this research is to describe the type of grammatical error faced by students in writing. This research used descriptive qualitative method. This research was carried out in using descriptive writing text to find out what types of error made by students of the tenth grade students MAN 1 Palu in writing and what causes of the students error in writing. The result of the research showed that the tenth grade students MAN 1 Palu still made 41 errors in their writing. They are three classification of error based on surface strategy taxonomy. The high frequency of error is selection (63,41%), omission (26,82), and The lowest frequency of error is addition (9,75). On the other hand, the highest cause of error is carelessness (75,6%), %), first language (7 or 17,07 %), while the lowest cause of error is translation (7.31%).</p>'),
(2, 'en_US', 'prefix', ''),
(2, 'en_US', 'subtitle', ''),
(3, 'en_US', 'title', 'DEVELOPING VOCABULARY MASTERY THROUGH GUESSING WORDS GAME FOR THE SEVENTH GRADE STUDENTS OF SMP NEGERI 10 PALU'),
(3, 'en_US', 'cleanTitle', 'DEVELOPING VOCABULARY MASTERY THROUGH GUESSING WORDS GAME FOR THE SEVENTH GRADE STUDENTS OF SMP NEGERI 10 PALU'),
(3, 'en_US', 'abstract', '<p>The objectives of this research was to know the process of learning English vocabulary by using guessing words game and to know the studentsâ€™ problem in learning English vocabulary by using guessing words game for the seventh grade students of SMP Negeri 10 Palu in academic year of<br>2019/2020 with the use of guessing words game technique. In this research, the researcher used qualitative research method. The researcher chose class VII D as sample which consisted of 23 students. In collecting the data, the researcher used four kinds of instruments, they were: observation,<br>interview, test and document. Based on the observation, there are some problems in the teaching and learning. To solve those problems, the researcher implemented guessing words game as vocabulary activities. This research was conducted through classroom action research that consisted of two cycles. Each cycles consisted three meetings. The result of the research showed that there were some improvements of the studentsâ€™ vocabulary. In cycle 1 average score was 62,86 there were some unsuccessful score. Meanwhile, in cycle 2 average score was 72,34 the implementation of guessing words game was successful in developing students vocabulary. Guessing words game gives better result to develop the studentsâ€™ vocabulary. In other words, guessing words game is effective to use in teaching English vocabulary.</p>'),
(3, 'en_US', 'prefix', ''),
(3, 'en_US', 'subtitle', ''),
(4, 'en_US', 'title', 'IMPROVING STUDENTSâ€™ SPEAKING SKILL THROUGH ROLE PLAY: AN ACTION RESEARCH FOR THE EIGHT GRADE STUDENTS OF SMP NEGERI 1 PEDONGGA'),
(4, 'en_US', 'cleanTitle', 'IMPROVING STUDENTSâ€™ SPEAKING SKILL THROUGH ROLE PLAY: AN ACTION RESEARCH FOR THE EIGHT GRADE STUDENTS OF SMP NEGERI 1 PEDONGGA'),
(4, 'en_US', 'abstract', '<p>Speaking is the special moment when the student can be improve their speaking in daily life or their classroom. With speaking the students can practice their knowledge of English and they can get new vocabularies. The objective of the research is to improve speaking skill for the eight grade students of SMP Negeri 1 Pedongga in the academic year of 2019/2020 with the use of role play method. Based on the observation, there were some problems in the teaching and learning of speaking. To solve those problems, the researcher implemented role play as a speaking activity.The research was carried out through action research that consisted of two cycles. Each cycle consisted of two meetings. The results of the research showed that there were some improvements in the students speaking skill. In cycle I, there were some unsuccessful actions. Meanwhile, in cycle II, the implementation of role play techniques was successful in improving the studentsâ€™ speaking skill. The conclusion of this research were the students low in speaking was caused by lack in vocabulary, self-confident, and they were confused how to pronounced the word. The success in teaching doesnâ€™t depend on the lesson program only, but more important is how to the teacher present the lesson and uses various method to manage the class.</p>'),
(4, 'en_US', 'prefix', ''),
(4, 'en_US', 'subtitle', ''),
(5, 'en_US', 'title', 'THE EFFECTIVENESS OF KNOW-WANTLEARNED (KWL) STRATEGY IN IMPROVING READING COMPREHENSION OF THE EIGHT GRADE STUDENTS OF SMP NEGERI 14 PALU'),
(5, 'en_US', 'cleanTitle', 'THE EFFECTIVENESS OF KNOWWANTLEARNED KWL STRATEGY IN IMPROVING READING COMPREHENSION OF THE EIGHT GRADE STUDENTS OF SMP NEGERI 14 PALU'),
(5, 'en_US', 'abstract', '<p>The problem focus of this research is to improve students reading comprehension by using Know-Want-Learned (KWL), to make the students comprehend the text, And how the students make their own conclusion about the text. The object of this research was the eighth grade students of SMP Negeri 14 Palu that were divided into two group that was controlled group and experimental group. The aim was to know their improvement after the treatment of KnowWant-Learned (KWL) technique. This research was quantitative research, and the procedure of collected the data were observation, interview, Pre test, treatment, and Post Test. The data analysis used statistical analysis that was descriptive analysis. Statistical analysis is used to test the hypothesis. And the formula used to test the hypothesis was t-test with the level of significance 0,05. The result showed that the application of Know-Want-Learned (KWL) strategy was successful in improving studentsâ€™ reading comprehension. It can be proven with the result of<br>test of significance (t-test) was 0,2496. It means the result of t-test is more than level of significance (0,05). Based on the conclusion above, suggested to the teacher especially English teacher is to use Know-Want-Learned (KWL) strategy or find out the other method to make the<br>students interest to the material.</p>'),
(5, 'en_US', 'prefix', ''),
(5, 'en_US', 'subtitle', ''),
(6, 'en_US', 'title', 'UTILIZING AUDIO VISUAL AIDS TO IMPROVE ENGLISH SPEAKING SKILL FOR THE EIGHT GRADE STUDENTS OF SMP NEGERI 3 BANAWA'),
(6, 'en_US', 'cleanTitle', 'UTILIZING AUDIO VISUAL AIDS TO IMPROVE ENGLISH SPEAKING SKILL FOR THE EIGHT GRADE STUDENTS OF SMP NEGERI 3 BANAWA'),
(6, 'en_US', 'abstract', '<p>This study aims to improve the speaking skill of the eighth grade students of SMP Negeri 3 Banawa in the use of audio visual aids. This research was conducted through action research consisting of two cycles. The data were obtained from observation during the implementation of the action; interview with Teacher of English and the eighth grade students from class VIII A; and discussion with Teacher of English. Data in the form of field notes, interview transcripts, and photographs. The validity of the data is obtained by applying utilization Audio Visual Aids, results and processes. The results show that there was an increase in students\' speaking skills through the use of audio visual aids. The audio-visual tool used in this study was video and slide. Videos were taken from youtube.com in the form of dialogue in certain expressions. These videos can attract students\' attention and increase their learning motivation. Students can have a better understanding of the use of English in real situations when they learn appropriate Englishlanguage models through audio-visual aids (video and slide). Students make improvements in several aspects of speaking skills, such as fluency and comprehensibility. They are more confident in speaking English. They actively participate during the teaching and learning process. In addition, they did not hesitate to ask the teacher when they found difficulties. The research findings are also supported by the results of students\' speaking achievement which increased from 57.78 in cycle I to 72.67 in cycle II.</p>'),
(6, 'en_US', 'prefix', ''),
(6, 'en_US', 'subtitle', ''),
