(20, 'en_US', 'title', 'IMPROVING READING COMPREHENSION THROUGH FOLKLORE STORY AT MAN 1 PALU'),
(19, 'en_US', 'abstract', '<p>This research aimes to investigate the significant effect of applying the jigsaw II learning method at the second-grade of MAS Nidaâ€™ul Khairaat Pombewe. The research employed quasi and need pre-test and post-test. The population of this research was all students of the second grade of MAS Nidaâ€™ul Khairaat Pombewe. The sample was selected by using quota sampling technique. The samples were 20&nbsp; students of IPS class as the controlled class and Agama class as the experimental class. The researcher analyzed the data statistically. The mean score of the experimental class was (67.05), it was higher than the mean score of the control class (45). The result of t-counted (2.327) which was higher than the t-table (2.153). The researcher used the 0.05 level of significance and the degree of freedom (df= 10 + 10 â€“ 2). This research has two hypotheses, which were &nbsp;: there is no improvement of the studentsâ€™ reading comprehension through the Jigsaw II learning method at the second grade of MAS Nidaâ€™ul Khairaat Pombewe and &nbsp;: there is improvement of the studentsâ€™ reading comprehension through the Jigsaw II learning method at the second grade of MAS Nidaâ€™ul Khairaat Pombewe.Based on the resuls of the data above it proven that &nbsp;was accepted and &nbsp;was rejected. In conclusion, the use of the Jigsaw II learning method can improve the studentsâ€™ reading comprehension at the second grade of MAS Nidaâ€™ul Khairaat Pombewe.</p>'),
(19, 'en_US', 'cleanTitle', 'IMPROVING STUDENTSâ€™ READING COMPREHENSION THROUGH THE JIGSAW II LEARNING METHOD AT THE SECONDGRADE OF MAS NIDAâ€™UL KHAIRAAT POMBEWE'),
(19, 'en_US', 'title', 'IMPROVING STUDENTSâ€™ READING COMPREHENSION THROUGH THE JIGSAW II LEARNING METHOD AT THE SECOND-GRADE OF MAS NIDAâ€™UL KHAIRAAT POMBEWE'),
(15, 'en_US', 'title', 'THE USING OF WHATSAPP IN TEACHING PRONUNCIATION PRACTICE TO THE THIRD SEMESTER STUDENTS OF TADRIS ENGLISH STUDY PROGRAM IN IAIN PALU'),
(15, 'en_US', 'cleanTitle', 'THE USING OF WHATSAPP IN TEACHING PRONUNCIATION PRACTICE TO THE THIRD SEMESTER STUDENTS OF TADRIS ENGLISH STUDY PROGRAM IN IAIN PALU'),
(15, 'en_US', 'abstract', '<p>This research focuses on the using of WhatsApp in teaching pronunciation practice to the third semester students of Tadris English Study Program in IAIN Palu. The research question is â€œHow is the using of WhatsApp in teaching Pronunciation Practice to the third semester students of Tadris English Study Program in IAIN Palu?â€ This is a qualitative research by using two instruments of data collections namely questionnaire and interview. The participants consisted of 19 third semester students of Tadris English Study Program of State Institute for Islamic Studies (IAIN) Palu. The researcher conducted five meetings of Pronunciation Practice class to the participants via WhatsApp before distributing the questionnaire and interview sheet. The questionnaire consisted of five questions by applying Likert Scale, while the interview consisted of ten questions. From the questionnaire and interview, the researcher concludes that the using of WhatsApp in teaching Pronunciation Practice to the third semester students of Tadris English Study Program in IAIN Palu is practical. The students could understand the material shared via WhatsApp in the form of documents shared, videos shared, as well as voice recording shared. They could use the features in WhatsApp well such as sharing documents, voice notes, sharing videos, video call and so on in learning pronunciation practice. The students like Pronunciation Practice Class and enjoy studying it via WhatsApp. Learning Pronunciation Practice via WhatsApp has some advantages such as time flexibility as well as structured and easily accessed materials. However, it also has some limitations such as internet data availability and video call limitation. Besides, the participants faced several obstacles in learning Pronunication Practice via WhatsApp, such as the limitation of smartphone memory to save files, down internet server, and unavailability of internet data. Nevertheless, they could passed those obstacles well by deleting some unused files to give more space to the memory and finding out wifi connection to stay connected to WhatsApp when the server was down or they ran out of internet data. They could understand the teaching of Pronunciation Practice via WhatsApp by downloading and reading the documents shared, the videos shared, and the voice recording shared by the lecturer. When they found a difficulty, they asked their friends or the lecturer via WhatsApp group.</p>'),
(15, 'en_US', 'prefix', ''),
(15, 'en_US', 'subtitle', ''),
