(13, 'en_US', 'title', 'DEVELOPING SPEAKING SKILL OF GRADE VIII STUDENTS  AT SMP NEGERI 1 PALU THROUGH INTERVIEW'),
(13, 'en_US', 'cleanTitle', 'DEVELOPING SPEAKING SKILL OF GRADE VIII STUDENTS  AT SMP NEGERI 1 PALU THROUGH INTERVIEW'),
(13, 'en_US', 'abstract', '<p>This research aims at developing Speaking Skill through Interview. Its method was quasi-experimental research non-equivalent control group design. Its population was the students of grade VIII at SMP Negeri 1 Palu, in which consists of thirteen parallel classes. The experimental class consists of 29 students and control class consists of 30 students. It was done in eight meetings. The variables of this research were speaking skill and interview. The samples of this research were students of grade VIII C and VIII D, selected through cluster sampling technique. Its results indicate that the application of interview has overcome the studentsâ€™ problem. After analyzing them, the result of t-counted was 10.01. By applying degree of freedom (df) 57(29+30-2), and the level significant 0.05, the value of t-table was 2.00. So,&nbsp; the value of t-counted was higher than t-table. It means that the hypothesis of this research was accepted. Thus, the interview can be applied to develop speaking skill of students grade VIII &nbsp;at &nbsp;SMP Negeri 1 Palu.</p>'),
(13, 'en_US', 'prefix', ''),
(13, 'en_US', 'subtitle', ''),
(13, 'en_US', 'copyrightHolder', 'Datokarama English Education Journal'),
(13, '', 'copyrightYear', '2021'),
(13, '', 'licenseURL', ''),
(13, '', 'pub-id::doi', '10.24239/dee.v1i2.13'),
(16, 'en_US', 'title', 'THE STRATEGIES OF AL-ISTIQOMAH NGATA BARU MODERN ISLAMIC BOARDING SCHOOLIN APPLYING ENGLISH SPEAKING SKILL TO SANTRI'),
(16, 'en_US', 'cleanTitle', 'THE STRATEGIES OF ALISTIQOMAH NGATA BARU MODERN ISLAMIC BOARDING SCHOOLIN APPLYING ENGLISH SPEAKING SKILL TO SANTRI'),
(16, 'en_US', 'abstract', '<p>In improving the English language skills of students, the Pondok Pesantren modern Al-istiqamah Ngata Baru has a language strategy. Students are required to communicate using English. However, in fact there are still some students whose English is still weak and left behind. The purpose of this study was to determine the strategy of the modern Al-istiqamah Ngata Baru Islamic boarding school in applying the speaking skills of the students.</p>\r\n<p>This research is used qualitative research. The research subjects were the head of the language field, the English teacher, the dormitory musyrif, the CLI (Central Language Improvement) board, and the students of the Al-istiqamah Ngata Baru Modern Islamic Boarding School. The technique used in determining the research subject is purposive sampling technique. Data collection techniques by interview, observation, and documentation. The data analysis techniques used were data collection, data reduction, data presentation, and verification.</p>\r\n<p>The results of this study indicate that the application of the strategy in English at Pondok Pesantren Modern Al-istiqamah Ngata Baru has been going well. With the English language strategy, the students \'English language skills continue to improve and with it the students understand better the lessons in class and the students\' achievement increases, and they are able to win the English competition.</p>'),
(16, 'en_US', 'prefix', ''),
(16, 'en_US', 'subtitle', ''),
(17, 'en_US', 'title', 'TEACHING PRESENT PROGRESSIVE TENSE THROUGH WHOLE BRAIN METHOD TO THE EIGHT GRADE STUDENTS OF SMP NEGERI 3 PALU'),
(17, 'en_US', 'cleanTitle', 'TEACHING PRESENT PROGRESSIVE TENSE THROUGH WHOLE BRAIN METHOD TO THE EIGHT GRADE STUDENTS OF SMP NEGERI 3 PALU'),
(17, 'en_US', 'abstract', '<p>This research aims to determine whether studentsâ€™ present progressive can be improved by using the Whole Brain Method. The participants were 20 eight grade students. The researcher had carried out research during the pandemic; the number of students was limited by the school. The research employed true experimental and need pre-test and post-test to both experimental class and control class. The population of this research is students in the grade VIII students of SMP Negeri Palu. The sample was selected by using random sampling technique. The samples are 20 students of class VIII A as the experiment class and VIII C as a control class. The research analyzed the data statistically data collection. The result of data analysis shows that the experimental class (85.5) is higher than the mean score of the control class (69). The deviation score of experimental class (17.64) is higher than of the control class (9.73). The result of t-counted (3.739) is higher than t-table (2.262). In analyzing the data, the researcher used 0.05 level of significance and the degree of freedom (df=10-2) it means that the hypothesis of the research was accepted. Therefore, the Whole Brain Method increase studentsâ€™ present progressive.</p>'),
