(21, 'en_US', 'title', 'STUDENTSâ€™ RESPONSES ON USING WHATSAPP DURING ONLINE LEARNING'),
(21, 'en_US', 'cleanTitle', 'STUDENTSâ€™ RESPONSES ON USING WHATSAPP DURING ONLINE LEARNING'),
(21, 'en_US', 'abstract', '<p>Recently, the use of mobile devices to communicate, learn, attain knowledge, and share information. Whatsapp as one of free downloaded device applications become the most popular platform, especially among university students. It is also regarded as one of teaching and learning media that could facilitate collaborative learning even though in this online classes due to Covid-19 pandemic.</p>\r\n<p>Challenges in attracting studentsâ€™ attention and interest become higher during online learning, since lecturer could not directly interact and teach students. Students are required to fast adapt this new way. This research investigates studentsâ€™ response on using Whatsapp as a learning tool during the online English Classes at State Islamic Institute of Palu. To get the result, there were 62 students of English Study Program at Tarbiyah and Teaching Education Faculty given 17 items of questionnaire. The result shows the majority of the students have positive responses and enjoy using Whatsapp as a learning tool during online classes. Even they love using Whatsapp.</p>'),
(21, 'en_US', 'prefix', ''),
(21, 'en_US', 'subtitle', ''),
(20, 'en_US', 'cleanTitle', 'IMPROVING READING COMPREHENSION THROUGH FOLKLORE STORY AT MAN 1 PALU'),
(20, 'en_US', 'abstract', '<p>This research aims to determine whether studentsâ€™ reading comprehension can be improved by using the Folklore Story. The participants were 20 eleventh grade students. The researcher had carried out research during the pandemic, the number of students was limited by the school. The research employed true experimental and need pre-test and post-test to both experimental class and control class. The population of this research is students in the eleventh grade of Man 1 Palu. The students were selected randomly. They are 20 students of class XI MIA 1 as the experiment class and XI MIA 4 as a control class. The research analysed the data statistically data collection. The result of data analysis shows that the experimental class (86) is higher than the mean score of the control class (69). The deviation score of experimental class (8.75) is higher than of the control class (5.37). So, the result of t-counted (1.644) which is higher than t-table (0.081). in analyzing the data, the researcher used 0.05 level of significance and the degree of freedom (df=10+10-2) it means that the hypothesis of the research was accepted. Therefore, the Folklore Story can improve studentsâ€™ reading comprehension.</p>'),
