(25, 'en_US', 'title', 'TEACHING PRONUNCIATION PRACTICE BY USING GOOGLE CLASSROOM TO THE SECOND SEMESTER STUDENTS OF ENGLISH TADRIS STUDY PROGRAM AT STATE INSTITUTE FOR ISLAMIC STUDIES PALU'),
(25, 'en_US', 'cleanTitle', 'TEACHING PRONUNCIATION PRACTICE BY USING GOOGLE CLASSROOM TO THE SECOND SEMESTER STUDENTS OF ENGLISH TADRIS STUDY PROGRAM AT STATE INSTITUTE FOR ISLAMIC STUDIES PALU'),
(25, 'en_US', 'abstract', '<p>This is a qualitative research with the objective to find out how the teaching of Pronunciation Practice by using Google Classroom to the second semester students of English Tadris Study Program of State Institute for Islamic Studies (IAIN) Palu is. There are three research questions in this research: (1) How did the lecturer teach Pronunciation Practice subject by using Google Classroom to the second semester students of English Tadris Study Program of State Institute for Islamic Studies Palu ?; (2) What are the advantages and limitations of using Google Classroom for teaching Pronunciation Practice to the second semester students of English Tadris Study Program of State Institute for Islamic Studies Palu?; and (3) What are the advantages and limitations of using Google Classroom for learning Pronunciation Practice based on the opinions of the second semester students of English Tadris Study Program of State Institute for Islamic Studies Palu? In gaining the date, the researcher used observation and interview as the instruments. From the observation, the researcher answered the first and second research questions as follow. The researcher did several steps in teaching Pronunciation Practice by using Google Classroom such as: (1) making three classes of Pronunciation Practice in Google Classroom for TBIG-1, TBIG-2, and TBIG-3; (2) sharing the link of Google Classroom to the students; (3) making the attendance list; (4) delivering the material to the students by attaching word files; (5) sharing YouTube videos of how native speaker pronouncing the sounds in the material; (6) giving assignment to the students by setting the deadline; and (7) returning the assignment to the students along with the score and the feedback in the comment column. The advantages by using Google Classroom for teaching Pronunciation Practice are as follow: (1) the easiness to deliver the material orderly; (2) the easiness to share YouTube videos; (3) the easiness to instruct an assignment; (4) the easiness to set the due date of the assignment; (5) the availability of scoring feature; (6) the privacy of lecturerâ€™s feedback; and (7) no need to save studentsâ€™ numbers. However, the limitations of Google Classroom are also found. Here are some of the limitations: (1) the unavailability of attendance feature; (2) the need of stable internet connection to upload a material file; and (3) the unavailability of feature to do oral class discussion. The third research question was answered by using the data from interview. The students described the advantages of using Google Classroom as follow: (1) easy to use; (2) flexible; (3) easy to send tasks; (4) not consuming much internet data; and (5) enabling students to watch YouTube videos shared by the lecturer related to the material discussed. However, they also noted some limitations of Google Classroom such as: (1) the unavailability of features like voice note and video call to have oral class discussion; (2) the difficulty to access it when the internet connection is not stable; and (3) the difficulty to send tasks when Google Drive is full.</p>'),
(25, 'en_US', 'prefix', ''),
(25, 'en_US', 'subtitle', ''),
(26, 'en_US', 'title', 'THE EFFECT OF INSTAGRAM IN LEARNING ENGLISH VOCABULARY '),
(26, 'en_US', 'cleanTitle', 'THE EFFECT OF INSTAGRAM IN LEARNING ENGLISH VOCABULARY '),
(26, 'en_US', 'abstract', '<p>The aims of this research are to find out the effect of Instagram in learning vocabulary of third semester students at English Tadris Study Program in IAIN Palu.&nbsp; This research was quantitative method and used total sampling. The subject of this research was the studentsâ€™ batch 2019 semester 3 academic year 2020-2021 in IAIN Palu. The total numbers of students of in this research were 102 students. After selected the sample of this research were 35 students. Research instrument is questionnaire.The technique of collection data was observation, and reduction.The result showed that Effect of Instagram in Learning Vocabulary of Third Semester Studentsâ€™ at English Tadris Study Program in IAIN Palu Academic year 2020/2021, used online media namely google form. The data revealed that the level of the mean score 62,48% from 35 students which was categorized as high effect. Then the research concluded that it is evident that Instagram have an effect on learning English (vocabulary) of student. It was revealed by the mean score 62,48%. The research was classified as high category of the studentsâ€™ questionnaire.</p>'),
(26, 'en_US', 'prefix', ''),
(26, 'en_US', 'subtitle', ''),
(29, 'en_US', 'title', 'THE EFFECT OF ANXIETY TOWARD STUDENTSâ€™ LEARNING MOTIVATION OF THE ELEVENTH GRADE AT SMAN 4 PALU'),
(29, 'en_US', 'cleanTitle', 'THE EFFECT OF ANXIETY TOWARD STUDENTSâ€™ LEARNING MOTIVATION OF THE ELEVENTH GRADE AT SMAN 4 PALU'),
(29, 'en_US', 'abstract', '<p>The objective of this research was to investigate the effect of anxiety toward studentsâ€™ learning motivation of the eleventh grade at SMAN 4 Palu in the academic year 2019- 2020. This research used as a survey quantitative research method. The population of this research was conducted for the eleventh-grade students of SMAN 4 Palu with consisted of 50 students, who used purposive sampling with took 2 classes as the samples to encourage representative data. In the procedure of collecting data, the researcher used one of instrument is questionnaire. The questionnaire used to encourage the effect of anxiety and the motivation in learning English of the students. The researcher was giving students a questionnaire using WhatsApp. The questionnaire in Google form, so students just open and checklist their answer and send. The result of the questionnaire has shown there was no significant effect of anxiety toward studentsâ€™ learning motivation. This result of Pearson Product Moment table, which has shown were scores of Sigs between effect Anxiety and Motivation was 0,450 or more than 0,05. It means there was no effect of anxiety toward motivation. The researcher concluding the effect of anxiety toward students\' learning motivation was normal.</p>'),
(51, 'en_US', 'cleanTitle', 'THE EFFECTIVENESS OF USING PICTURE TO IMPROVE SPEAKING ABILITY OF THE SECOND YEAR STUDENTS OF SMP NEGERI 1 KEFAMENANU'),
(51, 'en_US', 'abstract', '<p>Language is a human and non-instinctive method of communicating idea, feeling and desires by means of a system of sounds and sounds symbols. Speaking is a number of impossible from must be selected. Picture is visual representation (of in object or scene or person or abstraction).This study is aim to know whether there is an effect of using picture to improve the speaking ability of SMP Negeri 1 Kefamenanu. The method used to conduct this study is descriptive quantitate method. There were 20 students class VIII in the second grade students of juniopr high school as the sample of this study. The result of the formula above, it is done through the following procedure check the t-score by using 1 level of significance states in the low of one tailed test. One tailed test used instantly of two tailed is the tendency of the writer in order to match with the result of the two groups. Thus in accordance the result of the data analysis in this study concludes18 students have got score good 2 students got enough level. Based on the conclusion of data analysis the writer would like to give suggestion for the teacher and the students to pay attention more of the studying about speaking. Confronting with the large class teacher is expected to use a good method particularly communicative method that can help the students to be virtually independent for the spoken language.</p>'),
