(45, 'en_US', 'title', 'STUDENTSâ€™ PERCEPTION OF ONLINE LEARNING USING WHATSAPP DURING COVID-19 PANDEMIC'),
(45, 'en_US', 'cleanTitle', 'STUDENTSâ€™ PERCEPTION OF ONLINE LEARNING USING WHATSAPP DURING COVID19 PANDEMIC'),
(45, 'en_US', 'abstract', '<p>The purpose of this study is to find out students\' perceptions of online learning during the covid-19 pandemic by using WhatsApp. This research used quantitative descriptive research. The population of this research was 67 people, while the research sample used was simple random sampling based on the solving formula, so the sample in this study was 57 second semester of the English Tadris Department at UIN Datokarma Palu. The instrument used was a questionnaire. The results of the study indicate that online learning using the WhatsApp application has been going well or it can be interpreted that online learning during the pandemic using the WhatsApp application was very helpful. The percentage obtained in this study is; positive (4.38%), while the negative obtained (4.01%), and neutral (1.59%). Based on the percentages above, we can see that online learning using the WhatsApp application during the pandemic really helped students in the learning process even though they did not have face-to-face classes.</p>'),
(39, 'en_US', 'title', 'THE CORRELATION BETWEEN GRAMMAR COMPETENCY AND SPEAKING ABILITY OF THE EIGHTH GRADE STUDENTS  IN SMPN 1 PALU'),
(39, 'en_US', 'cleanTitle', 'THE CORRELATION BETWEEN GRAMMAR COMPETENCY AND SPEAKING ABILITY OF THE EIGHTH GRADE STUDENTS  IN SMPN 1 PALU'),
(39, 'en_US', 'abstract', '<p>This research was motivated by the problems experienced by some of the eighth grade students in SMPN 1 Palu. The students still had some difficulties when expressing their ideas or feelings by using English. They had various reasons for this. Most of them said that grammar is one of the causes of their difficulties in speaking English.</p>\r\n<p>This research was a correlational design, the technique of collecting data using test. There were two kinds of test such as written test and oral test as the research instrument. The written test was used to measure studentsâ€™ grammar competency and oral test was used to measure studentsâ€™ speaking ability. The researcher used Pearson Product Moment Correlation in analyzing the data by using SPSS program 26 version.</p>\r\n<p>Based on the results of the correlation analysis between the studentsâ€™ grammar competency and the students speaking ability, the r value was obtained at 0.407 (r &gt; 0.361) with p = 0.023 (p &lt;0.05) indicating that there was a significant positive correlation between studentsâ€™ grammar competency and studentsâ€™ speaking ability. This supported the alternative hypothesis to be accepted and the null hypothesis to be rejected. It could be concluded that there was a correlation between grammar competency and speaking ability at the eighth grade students of SMPN 1 Palu in the academic year of 2020/2021.</p>'),
(37, 'en_US', 'title', 'IMPROVING THE IMPLEMENTATION OF GOOGLE MEET TO IMPROVE THE ASPECT AND THE COMPONENT OF SPEAKING SKILL ON THE STUDENTS FROM NON ENGLISH SPEAKING BACKGROUND'),
(37, 'en_US', 'cleanTitle', 'IMPROVING THE IMPLEMENTATION OF GOOGLE MEET TO IMPROVE THE ASPECT AND THE COMPONENT OF SPEAKING SKILL ON THE STUDENTS FROM NON ENGLISH SPEAKING BACKGROUND'),
(37, 'en_US', 'abstract', '<p>The purpose of this study is to investigate how the use of google meet can improve the speaking ability of students of iain Intensive English 1 program Syekh Nurjati Cirebon. This particular research is categorized as action research. These actions are performed in three cycles based on the class schedule. The study involved 35 students. This research data is qualitative and quantitative data. Qualitative data is obtained by observing the teaching and learning process in speaking classes. Meanwhile, quantitative data is obtained through tests, and questionnaires. The findings suggest that the use of Google Meet terbukti meningkatkan keterampilan berbicara mahasiswa. Therefore google meet is very suitable to be used as online or virtual learning especially in improving students\' speaking skills that focus on aspects and components of student speaking skills, but there are some drawbacks that can make learning less effective and less efficient when used as a particular application in the learning and teaching process. Therefore, all educators who use application media such as google meet are able to master and professional in using the application. Hopefully this pandemic ends quickly and we can adjust how the future of education around the world goes forward.&nbsp; For the next researcher, can be focused on the influence of the implementation of google meet application in speaking subjects to the interest of students to improve speaking. Based on this study, researchers found students\' enthusiasm is very high in learning to speak, this proves that the google meet application can improve aspects and components of student speaking because it is influenced by increased student motivation during the use of google meet application compared to other applications.</p>'),
(37, 'en_US', 'prefix', ''),
(37, 'en_US', 'subtitle', ''),
(38, 'en_US', 'title', 'IMPROVING ENGLISH VOCABULARY MASTERY THROUGH TALKING STICK STRATEGY AT THE TENTH GRADE STUDENTS OF SMA NEGERI 1 KASIMBAR'),
(38, 'en_US', 'cleanTitle', 'IMPROVING ENGLISH VOCABULARY MASTERY THROUGH TALKING STICK STRATEGY AT THE TENTH GRADE STUDENTS OF SMA NEGERI 1 KASIMBAR');
