(47, 'en_US', 'cleanTitle', 'THE EFFECTIVENESS OF USING COMIC STRIPS TOWARD STUDENTS WRITING ABILITY IN MAKING DESCRIPTIVE TEXT'),
(47, 'en_US', 'abstract', '<p>The aim of this research is to find out the effectiveness of using comic strip toward writing ability in making descriptive text. The research belongs to experimental research. The population of this research is the eighth grade of SMPN 7 Ambon consisting 210 students. The researchers took 60 students as the samples and the samples were divided into control group (VIII 3) consists of 30 students and experimental group (VIII 2) consists of 30 students. The researchers conducted testing to get the data (pre-test and post-test) in control group and experimental group. The researchers used descriptive and inferential analysis to analyze the data. The descriptive analysis shows that the result of experimental group shows that in pre-test, the mean is 37.20, the standard deviation is 22.69, and the highest category belongs to very poor category with 53.3% (16 students). While in the post-test the mean is 60.60, the standard deviation is 27.47, and the highest category belongs to very good category with 30.0% (9 students). Meanwhile, the result of control group shows that in pre-test, the mean is 43.26, the standard deviation is 28.20, and the highest category belongs to very poor category with 40.0% (12 students). While in the post-test, the mean is 48.16, the standard deviation is 19.12, and the highest category belongs to fair category with 50.0% (15 students). It means the hypothesis is accepted. There is a significance difference between the students taught using comic strip in making descriptive and those taught without using comic strip in making descriptive text in the eighth grade of SMPN 7 Ambon.</p>'),
(39, 'en_US', 'prefix', ''),
(39, 'en_US', 'subtitle', ''),
(39, 'en_US', 'copyrightHolder', 'Datokarama English Education Journal'),
(46, 'en_US', 'abstract', '<p>The aim of this research was to improve students\' reading comprehension at the X grade of SMA Negeri 1 Kasimbar. The method applied was the quasi-experimental design with no equivalent control group, the design involved two groups of class. One group was treated as the experimental class, and another class group was the control class. In the experimental class, the researcher applied The RAP strategy and for the control class, the researcher does not apply this strategy. The population of this research was the X grade of SMA Negeri 1 Kasimbar which consisted of 168 students. The sample of this research consisted of 20 students, with the selected date by using the purposive sampling technique, 10 students for X IPA 3 as experimental class and 10 students from X IPA 2 as control class. The instrument used in this research was a reading test. The test was used in the pre-test and post-test. The implementation of this research was to improve the reading comprehension of the students by the (RAP) strategy. The mean score on the reading test before treatment with the (RAP) strategy read ask paraphrase was 60 and after treatment, the mean score was improved by 79.5. It means that the read-ask paraphrase (RAP) strategy to improve students\' reading comprehension at the X grade of SMA Negeri 1 Kasimbar is effective.</p>'),
