(41, 'en_US', 'title', 'THE IMPACT OF STUDENTSâ€™ MENTAL HEALTH IN ENGLISH ONLINE LEARNING DURING COVID-19 PANDEMIC AT SMA NEGERI 2 SOJOL'),
(41, 'en_US', 'cleanTitle', 'THE IMPACT OF STUDENTSâ€™ MENTAL HEALTH IN ENGLISH ONLINE LEARNING DURING COVID19 PANDEMIC AT SMA NEGERI 2 SOJOL'),
(41, 'en_US', 'abstract', '<p>The global pandemic that set by the World Health Organization on January 30, 2020 as a result of the new disease of Covid-19 has made many major changes, one of them in education where learning system are done through online. Online learning policies during the Covid-19 pandemic are the main solution to keeping the learning process going.This thesis aims to find out what impact of English online learning has on students\' mental health during the covid-19 pandemic at SMA Negeri 2 Sojol&nbsp; and To find out what factors hindered students in the process of English online learning at SMA Negeri 2 Sojol. In this research, the researcher applied a descriptive qualitative research which were located at SMA Negeri 2 Sojol. Data sources obtained through primary and secondary data. Data collection techniques used are&nbsp; questionnaire and interviews. Based on the results of the questioner showed that they tend to just felt bored, difficult to concentrate, feelings of fear or worry if they are unable to collect tasks on time as well as their difficulty in understanding the material when English online learning during the covid-19 pandemic. Where it is caused by several factors such as poor internet network, residential environment and also monotonous teaching techniques from English teachers.</p>'),
(41, 'en_US', 'prefix', ''),
(41, 'en_US', 'subtitle', ''),
(42, 'en_US', 'title', 'THE INFLUENCE OF USING CHORAL READING TECHNIQUE TO THE ELEVENTH GRADE STUDENTSâ€™ READING MASTERY AT SMA NEGERI 1KASIMBAR'),
(42, 'en_US', 'cleanTitle', 'THE INFLUENCE OF USING CHORAL READING TECHNIQUE TO THE ELEVENTH GRADE STUDENTSâ€™ READING MASTERY AT SMA NEGERI 1KASIMBAR'),
(42, 'en_US', 'abstract', '<p>This paper focuses on the using of choral reading technique to the eleventh grade studentsâ€™ reading mastery at SMA Negeri 1 Kasimbar. The writer applied quasi experimental research design and need pre-test and post-test to both experimental and control class. The pre-test was to know the level of studentsâ€™ reading mastery ability before giving treatment while the post-test was used to know the result after giving treatment. There was a significant difference score of the post-test of the experimental class (1.495) and the control class (1.235). The level of significance was set up 0,05 with 40 degree of freedom ( (df) = Nx + Ny = 21 + 21 + 40). The result of data analysis indicates that tcounted (3,729) which was higher than ttable, it means that the hypothesis of the research was accepted. Thus, there was significant influence of using choral reading technique to the eleventh grade students at SMA Negeri 1 Kasimbar.</p>'),
(42, 'en_US', 'prefix', ''),
(42, 'en_US', 'subtitle', ''),
(43, 'en_US', 'title', 'THE USE OF PODCAST MEDIA IN LITERAL LISTENING SUBJECT TO SECOND SEMESTER STUDENTS OF ENGLISH TADRIS STUDY PROGRAM 2020/2021 AT IAIN PALU'),
(43, 'en_US', 'cleanTitle', 'THE USE OF PODCAST MEDIA IN LITERAL LISTENING SUBJECT TO SECOND SEMESTER STUDENTS OF ENGLISH TADRIS STUDY PROGRAM 2020/2021 AT IAIN PALU'),
(43, 'en_US', 'abstract', '<p>This paper focuses on the use and response of students related to podcast media in literal listening subject to second semester students of the English Tadris Study Program at State Institute for Islamic Studies (IAIN) Palu. The author applies a qualitative research design. The method used in this research is interview and literature study, the results of the study show that the use and response of students regarding podcast media is good, this is evidenced by the results of interviews conducted by researchers with students who are taught using podcast media and lecturers who present material using podcast media.</p>'),
(43, 'en_US', 'prefix', ''),
(43, 'en_US', 'subtitle', ''),
