(47, 'en_US', 'subtitle', ''),
(48, 'en_US', 'title', 'TEACHING OF SPEAKING USING ASYNCHRONOUS E-LEARNING APPLICATIONS'),
(48, 'en_US', 'cleanTitle', 'TEACHING OF SPEAKING USING ASYNCHRONOUS ELEARNING APPLICATIONS'),
(48, 'en_US', 'abstract', '<p>This research aimed to find out the use of asynchronous e-learning applications in teaching speaking and describe studentsâ€™ perceptions of asynchronous e-learning applications in online English-speaking courses. The data in this research was collected qualitatively by using observation and focus group discussion. The observation was conducted on the use of asynchronous e-learning applications in teaching speaking. The focus group discussions have been done with thirteen students of Tadris English Department, UIN Datokarama Palu, who were taught using asynchronous e-learning in 2020/2021. This research showed that 1) in this asynchronous teaching and learning, lecturer and students use FlipGrid, WhatsApp group, and Google classroom. 2) the students had a positive perception of the use of asynchronous e-learning in online speaking courses, such as independent learning, and becoming more active, whereas the students also have negative perceptions such as lack of interaction and technical support.</p>'),
(48, 'en_US', 'prefix', ''),
(48, 'en_US', 'subtitle', ''),
(49, 'en_US', 'title', 'THE IMPLEMENTATION OF GUIDED QUESTIONS TECHNIQUE IN IMPROVING STUDENTSâ€™ ABILITY IN WRITING DESCRIPTIVE TEXT'),
(49, 'en_US', 'cleanTitle', 'THE IMPLEMENTATION OF GUIDED QUESTIONS TECHNIQUE IN IMPROVING STUDENTSâ€™ ABILITY IN WRITING DESCRIPTIVE TEXT'),
(49, 'en_US', 'abstract', '<p>This research aims at finding out whether the implementation of guided questions technique can improve the studentsâ€™ ability in writing descriptive text or not. The researcher applied a quasi-experimental research design which involved experimental class and control class. The population of this research was the second-grade students of SMP Negeri 1 Toribulu. The sample was VIII B as the control class and VIII C as the experimental class that consist of 20 students for each class. The researcher applied the purposive sampling technique. The instrument used to collect the data was test. The pre-test was administered to measure the studentsâ€™ ability in writing descriptive text before the treatment and the post-test was to measure the studentsâ€™ ability after the treatment. The data gathered from the test were analyzed statistically. The result of the data analysis shows that the hypothesis of the research was accepted regarding the analysis that the t<sub>counted </sub>(2,076) was higher than the t<sub>table </sub>(2,0042). The degree of freedom (df) of the table is Nx+Ny â€“ 2 = 20+20-2 = 38 with the level of significance at 0.05. it means that guided questions technique can improve the studentsâ€™ ability in writing descriptive text.</p>'),
(49, 'en_US', 'prefix', ''),
(49, 'en_US', 'subtitle', ''),
(50, 'en_US', 'title', 'THE IMPLEMENTATION OF PICTURE SERIES IN TEACHING NARRATIVE READING TEXT'),
(50, 'en_US', 'cleanTitle', 'THE IMPLEMENTATION OF PICTURE SERIES IN TEACHING NARRATIVE READING TEXT'),
(50, 'en_US', 'abstract', '<p>This research aimed at finding out the implementation of picture series in teaching narrative reading text to the eight grade students of MTs al-Khairaat Uemalingku Ampana. This research was qualitative research, the subjects of this research were teachers and students. The data collection methods employed in this study were observation, interviews, and documentation. The data sources used in this study were primary data and secondary data. Data analysis techniques used were data reduction, data presentation, and data verification. The result of this research showed that the implementation of Picture Series in Teaching Narrative Reading Text to the Eight grade Students of MTs al-Khairaat Uemalingku Ampana consists of the following steps: firstly, the teacher trained the students to think and directed them to find answer to problems by playing drawing games. Secondly, the teacher explained the material deeply, such as the step to write narrative text. Thirdly, the teacher distributed some random pictures to the students to short the pictures into a logical sequence and to find out the difference in the learning outcomes that had been achieved by students in learning narrative text. The learning evaluation was carried out at the end of the lesson.</p>'),
(50, 'en_US', 'prefix', ''),
(50, 'en_US', 'subtitle', ''),
