(55, 'en_US', 'abstract', '<p>This research aims to find out whether drilling technique can enhance studentsâ€™ pronunciation of suffix â€“ed in regular verbs or not. The researcher applied true experimental design which involved the experimental class and control class. The population of this research was the eighth-grade students of MTsN 2 Palu; VIII A as the experimental class and VIII B as the control class. The researcher used a cluster random sampling technique. The instruments used to collect the data were tests, recordings, and observation sheets. The pre-test was conducted to measure the studentsâ€™ pre-ability before obtaining the treatment and the post-test was to measure the studentsâ€™ ability after obtaining the treatment. The data obtained from the scores of the studentsâ€™ test were analyzed statistically. The result of data analysis shows that the alternative hypothesis of this research was accepted by regarding to the analysis of t<sub>counted </sub>(2.84) was higher than t<sub>table</sub> (1.69) by applying 0.05 level of significance with degree of freedom (df) is N<sub>1</sub> + N<sub>2</sub> â€“ 2 = 29 which means that drilling technique can enhance studentsâ€™ pronunciation of suffix â€“ed in regular verbs.</p>'),
(55, 'en_US', 'prefix', ''),
(55, 'en_US', 'subtitle', ''),
(56, 'en_US', 'title', 'IMPROVING VOCABULARY MASTERY BY USING SHORT STORIES'),
(56, 'en_US', 'cleanTitle', 'IMPROVING VOCABULARY MASTERY BY USING SHORT STORIES'),
(56, 'en_US', 'abstract', '<p>This research aims to find out whether short stories can be successful in improving students\' vocabulary mastery or not. The researcher used quantitative research with experimental design using one-group-pretest-posttest. The sample of this research is class XI IPA 2 students of SMA Negeri 6 Palu that consists of 15 students. This class is taken as the experimental class, and the class is taught by using a short story, specifically about the legend. The selection of samples in this research used purposive sampling. After conducting the test, the researcher got the mean score of the students\' pre-test is 48.33 while the average score of the post-test is 74.00. Then the data were analyzed using the t-<sub>test</sub> formula. The result of data analysis shows that t-<sub>count</sub> was greater than t-t<sub>able</sub>, t-count = 6.282 and t-<sub>table</sub> = 1.771 at a significance level of 0.05. It can be concluded that there is a significant improving in students\' vocabulary mastery after using short stories as learning materials.</p>'),
(56, 'en_US', 'prefix', ''),
(56, 'en_US', 'subtitle', ''),
(57, 'en_US', 'title', 'THE USE OF BILINGUAL FABLE TO IMPROVE STUDENTSâ€™ VOCABULARY'),
(57, 'en_US', 'cleanTitle', 'THE USE OF BILINGUAL FABLE TO IMPROVE STUDENTSâ€™ VOCABULARY'),
(57, 'en_US', 'abstract', '<p>This research aims to find out the improvement of studentsâ€™ vocabulary after being taught by using Bilingual Fable of the sixth-grade students at SDN 5 Tentena, Poso. The method used in this research was Classroom Action Research (CAR). To analyze the data, the researcher used test, descriptive quantitative analysis. The result of this study shows that in the pre-cycle the studentâ€™s average score is 42. In the first cycle the studentsâ€™ average score is 61, while in the second cycle the studentsâ€™ average score is 72. From pre-cycle, first cycle and second cycle, the average of the students score is always increasing. It can be concluded that the use of Bilingual Fable as media to improve studentsâ€™ vocabulary is also able to make students interest and motivate in learning process. Thus, the use of bilingual fable is effective in improving studentsâ€™ vocabulary.</p>'),
(57, 'en_US', 'prefix', ''),
(57, 'en_US', 'subtitle', ''),
(58, 'en_US', 'title', 'THE EFFECTIVENESS OF USING PICTURE TO IMPROVE SPEAKING ABILITY OF THE SECOND YEAR STUDENTS OF SMP NEGERI 1 KEFAMENANU'),
(58, 'en_US', 'cleanTitle', 'THE EFFECTIVENESS OF USING PICTURE TO IMPROVE SPEAKING ABILITY OF THE SECOND YEAR STUDENTS OF SMP NEGERI 1 KEFAMENANU'),
(58, 'en_US', 'abstract', '<p>Language is a human and non-instinctive method of communicating idea, feeling and desires by means of a system of sounds and sounds symbols. Speaking is a number of impossible from must be selected. Picture is visual representation (of in object or scene or person or abstraction). This study is aim to know whether there is an effect of using picture to improve the speaking ability of SMP Negeri 1 Kefamenanu. The method used to conduct this study is descriptive quantitate method. There were 20 students class VIII in the second grade students of junior high school as the sample of this study. The result of the formula above, it is done through the following procedure check the t-score by using 1 level of significance states in the low of one tailed test. One tailed test used instantly of two tailed is the tendency of the writer in order to match with the result of the two groups. Thus, in accordance the result of the data analysis in this study concludes18 students have got score good 2 students got enough level. Based on the conclusion of data analysis the writer would like to give suggestion for the teacher and the students to pay attention more of the studying about speaking. Confronting with the large class teacher is expected to use a good method particularly communicative method that can help the students to be virtually independent for the spoken language.</p>'),
(58, 'en_US', 'prefix', ''),
(58, 'en_US', 'subtitle', ''),
(59, 'en_US', 'title', 'A SOCIOLINGUISTIC ANALYSIS OF GENDER ON ENGLISH USE AT THE THIRD GRADE OF MTSN 2 PALU'),
(59, 'en_US', 'cleanTitle', 'A SOCIOLINGUISTIC ANALYSIS OF GENDER ON ENGLISH USE AT THE THIRD GRADE OF MTSN 2 PALU'),
(59, 'en_US', 'abstract', '<p>The students at the third grade of MTs N 2 Palu have different social context in their life. Since different students in different societies have distinct ways of life, and language to a considerable degree is influenced by culture. The factors above against this background that this study is carried out to examine how the differences in English use of men and women and at the third grade of MTs N 2 Palu. This research discusses about the differences between men and women in using English. Considering the purpose of the research and the nature of the problem, this research was a qualitative-research. To collect the data the researcher used observation, interview, and video recording. The result of this study shows that the difference between the students in using English is influenced by the social context especially in cultural aspect. When the students use English, the accent of each culture follows into their English. It also affects the intonations and accent when they use English. While, the differences between men and women. Women found it easier to adjust their accents and distinguish accents from the culture and accents of the English. While, man found it difficult. So, when using English men are often carried away with accents from their own culture.</p>'),
(59, 'en_US', 'prefix', ''),
(59, 'en_US', 'subtitle', ''),
(60, 'en_US', 'title', 'THE EFFECT OF USING LISTENING-READING-DISCUSSION (LRD) STRATEGY ON STUDENTS UNDERSTANDING OF READING NARRATIVE TEXT AT MTS PALASA'),
(60, 'en_US', 'cleanTitle', 'THE EFFECT OF USING LISTENINGREADINGDISCUSSION LRD STRATEGY ON STUDENTS UNDERSTANDING OF READING NARRATIVE TEXT AT MTS PALASA'),
(60, 'en_US', 'abstract', '<p>The reading comprehension of grade IX students of MTs Palasa is still low, especially in reading narrative texts. so that the researcher was motivated to discuss the thesis entitled \"The Effect of Using Listening-Reading-Discussion (LRD) Strategy on Students\' Understanding of Reading Narrative Text at Mts Palasa\". This research aims to obtain empirical evidence about the effect of using listening-read-discussion strategies on students\' understanding of reading narrative texts. This research method is quantitative. The research design used is quasi-experimental. In the experimental class, the researcher used the listening-read-discuss method and in the control class, the researcher methods that are often used by teachers at the school, in 8 meetings with a time of 80 minutes for each class. The researcher used an instrument in the form of multiple choice. The instrument is given in pre-test and post-test. Before giving the treatment, the researcher gave a pre-test for the second class. Then after the treatment, the instrument was given in the form of a posttest. After giving the pre-test and post-test, the researcher analyzed the data using SPSS 25 to calculate the independent sample t-test. From the analysis of the data calculated using SPSS 25, this research shows differences in the value of the final significant mean between the classes, from the experimental class, was 70.00, while the final mean of the control class is 58.50. The hypothesis test shows that sig. 2 tailed (p) is 0.001 with alpha (Î±) is 0.05, so 0.002 &lt; 0.05. It can be stated that Ho (Null Hypothesis) has been rejected and Ha (Alternative Hypothesis) was accepted. Therefore, it can be concluded that the use of listening-reading-discussion strategi affects the reading comprehension of ninth-grade students of MTs Palasa on narrative texts in the 2021/2022 academic year.</p>'),
(60, 'en_US', 'prefix', ''),
(60, 'en_US', 'subtitle', ''),
