(61, 'en_US', 'title', 'The Influence of Using Short story Animation on Students\' Vocabulary mastery'),
(61, 'en_US', 'cleanTitle', 'The Influence of Using Short story Animation on Students Vocabulary mastery'),
(61, 'en_US', 'abstract', '<p>This research purpose was to determine the influence of short story narrative text on studentsâ€™ vocabulary mastery at the 10<sup>th</sup> grade of SMAN 1 PETIR. This research was done by true-experimental with random sampling. The population of this research was all of the first-grade high school students in Banten province, consisting of 350 students. The researcher used two classes, X MIPA 4 as the experimental and X MIPA 5 as the control class. Both classes consisted of 35 students. In obtaining the data, the researcher used multiple-choice questions as instruments. Try out was conducted as the first step to get the data. After conducting the tryout, the researcher gave a pre-test in both classes. The researcher gave the treatment in the experimental class using Short Story Animation as a media, and in the control class, the discussion method used a module. The result of the calculation by Independent T-test found that (0,002 &lt; 0,005), which means the hypothesis alternative (Ha) is accepted. The effectiveness of using Short Story Animation Narrative Text can be seen in the ability obtained after the treatment.</p>'),
(61, 'en_US', 'prefix', ''),
(61, 'en_US', 'subtitle', '');
